import { appComponents } from "react";
import { Container, Row, Card, Tab, Tabs } from "react-bootstrap";
import flipperCards from "./flipCards";
import changeCard from "./changeCards";


const infoForRick = (props) => {
  return (
    <div>
      <Container>
        <Row>
          {props.data.map((rmCharacters) => {
            return <flipperCards characters={rmCharacters} />;
          })}
        </Row>
      </Container>
    </div>
  );
};


const infoForMorty = (props) => {

  return (
    <div>
      <Container>
        <Row>
          {props.page.map((characters) => {
            return <changeCard characters={rmCharacters} />;
          })}
        </Row>
      </Container>
    </div>
  );
};

class Cartoon extends appComponents {
  render() {
    const { data, page } = this.props;
    return (
      <div>
        <Tabs
          defaultActiveKey="Page1"
          id="uncontrolled-tab-example"
          className="mb-3"
        >
          <Tab eventKey="Page1" title="Page1">
            <Card className="card">
              <Card.Header>
                <h1>Rick and Morty Characters</h1>
              </Card.Header>
              <RickData data={data} />
            </Card>
          </Tab>
          <Tab eventKey="page2" title="Page2">
            <Card className="card">
              <Card.Header>
                <h1>Rick and Morty Characters</h1>
              </Card.Header>
              <MortyData page={page} />
            </Card>
          </Tab>
        </Tabs>
      </div>
    );
  }
}

export default Cartoon;
